import React from 'react';
import './css/UI.css'

function List(title,desc){
  title ="Morning Activity";
  desc ="Wake up early and take a jogg with my friend. Also, pick up coffee for breakfast.";
  return(
    <div className="list">
    <div className="title">{title}</div>
    <div className="desc">{desc}</div>
    </div>
  );
}
export default List;
